INSERT INTO `tb_warncode` VALUES ('1', 'W1-01', '气泡检测', '●检测到气泡时发生', '① 确认管路中有无气泡。\r\n② 确认管路的安装。\r\n③ 排除气泡后按解除键。', '1', '1.用止血钳夹住气泡检测器下流部位；\r\n2.使用液面调整泵；\r\n  将静脉压调整至50mmHg一下；\r\n  注意静脉压管路的滤过器不要沾湿；\r\n3.排除气泡；\r\n4.取下止血钳；\r\n5.打开夹管阀V1和V2；\r\n6.顺时针旋转旋钮，血泵速度从5mL/min开始；\r\n7.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('2', 'W1-02', '采血不良(BP减速运转)', '●采血压(Pacc)低于下限设定值+预报警设定值时发生\r\n●报警发生时,血液泵以当前速度的20%运转', '① 确认有无针头堵塞、采血部位穿刺不良的情况。\r\n② 确认管路有无折叠。\r\n③ 处理后按解除键，血液泵以显示的流量再次运转。', '2', '1.查看管路是否折叠；\r\n2.确认有无针头堵塞、采血部位穿刺不良的情况。\r\n3.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('3', 'W1-03', '采血不良(BP停止)', '●采血压(Pacc)低于下限设定值时发生。', '① 确认有无针头堵塞、采血部位穿刺不良的情况。\r\n② 确认管路有无折叠。\r\n③ 处理后按解除键，血液泵以显示的流量再次运转。', '1', '1.查看管路是否折叠；\r\n2.确认有无针头堵塞、采血部位穿刺不良的情况。\r\n3.将夹管阀V1、V2松开，用旋钮控制血泵BP的速度，血泵BP将从5mL/min开始运行；\r\n4.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('4', 'W1-04', '静脉压(Pven)上限预警', '●静脉压(Pven)高于上限设定值-预报警设定值时发生。', '① 确认有无针头堵塞、采血部位穿刺不良的情况。\r\n② 确认管路有无折叠。\r\n③ 处理后按解除键。', '4', null, null);
INSERT INTO `tb_warncode` VALUES ('5', 'W1-05', '静脉压(Pven)上限警报', '●静脉压(Pven)高于上限设定值时发生。', '① 确认有无针头堵塞、采血部位穿刺不良的情况。\r\n② 确认管路有无折叠。\r\n③ 处理后按解除键。', '1', '1.确认有无针头堵塞、采血部位穿刺不良的情况；\r\n2.确认管路有无折叠；\r\n3.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('6', 'W1-06', '静脉压(Pven)下限警报', '●静脉压(Pven)低于下限设定值时发生。', '① 确认管路连接部分有无松弛、脱落。\r\n② 处理后按解除键。', '1', '1.确认管路连接部分有无松弛、脱落；\r\n2.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('7', 'W1-07', '动脉压(Part)上限预警', '●动脉压（Part）高于上限设定值-预报警设定值时发生。', '① 确认膜件堵孔情况。\r\n② 确认管路有无折叠。\r\n③ 处理后按解除键。', '4', null, null);
INSERT INTO `tb_warncode` VALUES ('8', 'W1-08', '动脉压(Part)上限警报', '●动脉压(Part)高于上限设定值时发生。', '① 确认膜件堵孔情况。\r\n② 确认管路有无折叠。\r\n③ 处理后按解除键。', '1', '1.确认膜件堵孔情况；\r\n2.确认管路有无折叠；\r\n3.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('9', 'W1-09', '动脉压(Part)下限警报', '●动脉压(Part)低于下限设定值时发生。', '① 确认管路连接部的松驰、脱落。\r\n② 处理后按解除键。', '1', '1.确认管路连接部的松驰、脱落；\r\n2.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('10', 'W1-10', '滤过压/血浆压(P1st)上限警报', '●滤过压（P1st）高于上限设定值时发生。', '① 确认管路有无折叠。\r\n② 处理后按解除键。', '2', '1.确认管路有无折叠；\r\n2.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('11', 'W1-11', '滤过压/血浆压(P1st)下限警报', '●滤过压（P1st）低于下限设定值时发生。', '① 确认膜件有无堵孔。\r\n② 处理后按解除键。', '2', '1.确认膜件有无堵孔；\r\n2.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('12', 'W1-12', '血浆压(P1st)上限警报', '●血浆压（P1st）高于上限设定值时发生。', '① 确认管路有无折叠。\r\n② 处理后按解除键。', '4', '', null);
INSERT INTO `tb_warncode` VALUES ('13', 'W1-13', '血浆压(P1st)下限警报', '●血浆压（P1st）低于下限设定值时发生。', '① 确认膜件有无堵孔。\r\n② 处理后按解除键。', '4', '', null);
INSERT INTO `tb_warncode` VALUES ('14', 'W1-14', '血浆入口压(P2nd)上限警报', '●血浆入口压1（P2nd）高于上限设定值时发生。', '① 确认膜件有无堵孔。\r\n② 处理后按解除键。', '2', '1.确认膜件有无堵孔；\r\n2.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('15', 'W1-15', '血浆入口压(P2nd)下限警报', '●血浆入口压1（P2nd）低于下限设定值时发生。', '① 确认管路连接部有无松驰、脱落。\r\n② 按解除键。', '2', '1.确认管路连接部有无松驰、脱落；\r\n2.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('16', 'W1-16', '抗凝剂泵(SP)注射器识别错误', '●抗凝剂泵无法识别当前注射器型号', '①注射器安装错误\r\n②所使用的注射器未非标准注射器\r\n③重新安装注射器\r\n④在[其他设置]界面，按[清除警报]按键，解除抗凝剂泵警报\r\n⑤处理后按解除键', '3', null, null);
INSERT INTO `tb_warncode` VALUES ('17', 'W1-17', '抗凝剂泵(SP)推头错误', '●抗凝剂泵推头安装错误\r\n', '①检查注射器是否脱落、抗凝剂泵推头是否安装正确\r\n②在[其他设置]界面，按[清除警报]按键，解除抗凝剂泵警报\r\n③处理后按[消除]键，并重新运行抗凝剂泵。', '3', '', null);
INSERT INTO `tb_warncode` VALUES ('18', 'W1-18', '跨膜压(TMP)上限警报', '●跨膜压(TMP)高于上限设定值时发生。', '① 确认膜件有无堵孔。\r\n② 处理后按解除键。', '2', '① 确认膜件有无堵孔。\r\n② 处理后按解除键。', null);
INSERT INTO `tb_warncode` VALUES ('19', 'W1-19', '跨膜压(TMP)下限警报', '●跨膜压(TMP)低于下限设定值时发生。', '① 确认泵流量设定值。\r\n② 确认有无逆滤过。\r\n③ 确认管路有无折叠。\r\n④ 处理后按解除键。', '2', '① 确认泵流量设定值。\r\n② 确认有无逆滤过。\r\n③ 确认管路有无折叠。\r\n④ 处理后按解除键。', null);
INSERT INTO `tb_warncode` VALUES ('20', 'W1-20', '抗凝剂泵(SP)接近完成', '●抗凝剂累积量将要达到预置量值', '①抗凝剂即将注射完\r\n②请准备好其他注射器\r\n', '3', null, null);
INSERT INTO `tb_warncode` VALUES ('21', 'W1-21', '抗凝剂泵(SP)注射完成', '●累积量达到预置量时\r\n●注射器推杆到达顶部时', '①抗凝剂累积量已达到预置量值\r\n②按[消除]键，根据提示更换注射器\r\n', '3', '1.更换注射器前，请关闭动脉壶与注射器连接管路上的管夹；\r\n2.取下空注射器，准备更换新注射器；\r\n3.将注射器卡入固定块中，用锁定干锁定注射器；\r\n4.打开推杆上的小夹子夹住注射器推杆；\r\n5.确认上述安装到位后，打开动脉壶与注射器连接管路上的管夹;\r\n6.可以【快速注入】或直接【运行】注射泵；\r\n7.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('22', 'W1-22', '旁路开放', '●差压（动脉压－静脉压）超过旁路开放压时发生。', '① 确认膜件有无堵孔。\r\n② 停止血液泵后转至回收。\r\n③ 处理后按解除键。\r\n④ 进行回收操作。', '4', '', null);
INSERT INTO `tb_warncode` VALUES ('23', 'W1-23', '漏血检测(LD)', '●检测到漏血时发生。', '① 采集滤液/分离的血浆样品进行分析、确定是否有漏血。\r\n②管路中是否混入空气。', '1', '1.有漏血时：\r\n   更换膜件和管路； \r\n2.管路中混入空气时：\r\n   排除空气；\r\n3.若需要运转血泵，可松开夹管阀V1和V2，用旋钮控制血泵运转；\r\n4.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('24', 'W1-24', '血液泵(BP)停止了', '●在治疗开始后，血液泵的开关变为OFF 时发生。\r\n●在检测到血液时，血液泵停止了2分钟以上时发生。', '① 注意无血液凝固。\r\n② 运转血液泵。', '1', '① 注意无血液凝固。\r\n② 运转血液泵。', null);
INSERT INTO `tb_warncode` VALUES ('25', 'W1-25', '抗凝剂泵(SP)过负荷', '●在抗凝剂泵运转中，推杆过负荷时发生。\r\n●在抗凝剂泵运转中，锁定杆不在锁定位值时发生。\r\n●快送或大剂量注入中，注射器推到底时，会发生（SP）过负荷或（SP）动作异常。', '① 确认抗凝剂管路有无折叠或阻塞。\r\n② 确认锁定杆的位置。\r\n③ 在[其他设置]界面，按[清除警报]按键，解除抗凝剂泵警报。', '3', '1.抗凝剂泵触发此报警一般情况为，推杆无法按正常速度推进，即注射器内压力达到报警限值！\r\n2.请查看管路是否折叠；\r\n3.注射器与动脉壶连接管上的管夹是否夹住，如夹住了请打开；\r\n4.输往动脉壶的管路有无堵孔；\r\n5.观察动脉压是否正常；\r\n6.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('26', 'W1-26', '抗凝剂泵(SP)电机运行错误', '●在抗凝剂泵电机运转发生错误时发生报警', '① 在[其他设置]界面，按[清除警报]按键，解除抗凝剂泵警报\r\n② 处理后按解除键。\r\n③ 如再发生，则要对装置进行检修。', '3', '1.请在【其他设置】界面，按【清除警报】键，尝试解除当前警报；\r\n2.若【清除警报】后，抗凝剂泵仍无法改变次警报状态，请妥善处理当前警报，并请联系技术人员进行维修；\r\n3.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('27', 'W1-27', '血液泵(BP)异常', '●在运转中泵停止时发生。\r\n●转子的转数不能按设定速度运转时发生。', '① 确认泵管是否安装正确。\r\n② 确认转子是否安装正确。\r\n③ 处理后按解除键。\r\n④ 再发生时，要对装置进行检修。', '1', null, null);
INSERT INTO `tb_warncode` VALUES ('28', 'W1-28', '分离泵(FP)异常', '●在运转中泵停止时发生。\r\n●转子的转数不能按设定速度运转时发生。', '① 确认泵管是否安装正确。\r\n② 确认转子是否安装正确。\r\n③ 处理后按解除键。\r\n④ 再发生时，要对装置进行检修。', '1', null, null);
INSERT INTO `tb_warncode` VALUES ('29', 'W1-29', '透析液泵(DP)异常', '●在运转中泵停止时发生。\r\n●转子的转数不能按设定速度运转时发生。', '① 确认泵管是否安装正确。\r\n② 确认转子是否安装正确。\r\n③ 处理后按解除键。\r\n④ 再发生时，要对装置进行检修。', '1', null, null);
INSERT INTO `tb_warncode` VALUES ('30', 'W1-30', '返液泵(RP)异常', '●在运转中泵停止时发生。\r\n●转子的转数不能按设定速度运转时发生。', '① 确认泵管是否安装正确。\r\n② 确认转子是否安装正确。\r\n③ 处理后按解除键。\r\n④ 再发生时，要对装置进行检修。', '1', null, null);
INSERT INTO `tb_warncode` VALUES ('31', 'W1-31', '滤过泵(FP2)异常', '●在运转中泵停止时发生。\r\n●转子的转数不能按设定速度运转时发生。', '① 确认泵管是否安装正确。\r\n② 确认转子是否安装正确。\r\n③ 处理后按解除键。\r\n④ 再发生时，要对装置进行检修。', '1', null, null);
INSERT INTO `tb_warncode` VALUES ('32', 'W1-32', '循环泵(CP)异常', '●在运转中泵停止时发生。\r\n●转子的转数不能按设定速度运转时发生。', '① 确认泵管是否安装正确。\r\n② 确认转子是否安装正确。\r\n③ 处理后按解除键。\r\n④ 再发生时，要对装置进行检修。', '1', null, null);
INSERT INTO `tb_warncode` VALUES ('33', 'W1-33', '供电恢复', '●在电池驱动中，恢复供电时发生。', '① 按解除键。', '4', null, null);
INSERT INTO `tb_warncode` VALUES ('34', 'W2-01', '透析液空(AD2)', '●气泡检测器（AD2）检测到气泡时发生；', '① 确认输液是否空了,有必要时更换液袋。\r\n② 确认空检测器是否安装正确。\r\n③ 处理后按解除键。', '2', '1.查看空检测器AD2所监测的输液袋是否为空：\r\n   输液袋空时请更换新输液袋；\r\n2.确认空检测器AD2是否安装到位；\r\n3.处理后按【确定】。\r\n', );
INSERT INTO `tb_warncode` VALUES ('35', 'W2-02', '补液空(AD3)', '●气泡检测器（AD3）检测到气泡时发生；', '① 确认输液是否空了,有必要时更换液袋。\r\n② 确认空检测器是否安装正确。\r\n③ 处理后按解除键。', '2', '1.查看空检测器AD3所监测的输液袋是否为空：\r\n   输液袋空时请更换新输液袋；\r\n2.确认空检测器AD3是否安装到位；\r\n3.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('36', 'W2-03', '血液泵(BP)门开', '●血液泵运转中，泵门打开时发生。', '① 确认泵管是否安装正确。\r\n② 关闭泵门，按解除键。', '1', null, null);
INSERT INTO `tb_warncode` VALUES ('37', 'W2-04', '泵门开', '●FP、DP、RP、FP2、CP 运转中，泵门打开时发生。', '① 确认泵管是否安装正确。\r\n② 关闭泵门，按解除键。', '2', null, null);
INSERT INTO `tb_warncode` VALUES ('38', 'W2-05', '闭锁器(CV)盖开', '●闭锁器盖打开时发生。', '① 确认管路是否安装正确。\r\n② 确认闭锁器盖是否关好。', '1', null, null);
INSERT INTO `tb_warncode` VALUES ('39', 'W2-06', '加温器(HT)盖开', '●在加温器驱动中门打开时发生。', '① 确认管路是否安装正确。\r\n② 确认加温器旋钮是否在锁定位置。\r\n③ 处理后按解除键。', '4', null, null);
INSERT INTO `tb_warncode` VALUES ('40', 'W2-07', '过升温警报', '●加温器的加热面超过40.8℃时发生。由硬件检测。', '① 确认管路是否安装正确。\r\n② 让加温器OFF。\r\n③ 按解除键。\r\n④ 经过一定时间后让加温器ON。\r\n⑤ 如再发生，则要对装置进行检修。', '2', '① 确认管路是否安装正确。\r\n② 让加温器OFF。\r\n③ 按解除键。\r\n④ 经过一定时间后让加温器ON。\r\n⑤ 如再发生，则要对装置进行检修。', null);
INSERT INTO `tb_warncode` VALUES ('41', 'W2-08', '监测用温度传感器回路断线', '●加温器异常。', '① 按解除键。\r\n② 如再发生，则要对装置进行检修。', '2', '1.发生此报警，可能是温度值有跳变，请[解除]当前报警；\r\n2.解除报警一次后，仍发生该报警，请及时联系技术人员进行维修；\r\n3.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('42', 'W2-09', '控制用温度传感器回路断线', '●加温器控制用热电阻断线时发生。', '① 按解除键。\r\n② 如再发生，则要对装置进行检修。', '2', '1.发生此报警，可能是温度值有跳变，请[解除]当前报警；\r\n2.解除报警一次后，仍发生该报警，请及时联系技术人员进行维修；\r\n3.处理后按【确定】。', );
INSERT INTO `tb_warncode` VALUES ('43', 'W2-10', '温度偏离设定值警报', '●加温器的加热面偏离设定温度±1℃时发生。由硬件检测。', '① 确认管路是否安装正确。\r\n② 让加温器ON。\r\n③ 按解除键。 \r\n④ 如再发生，则要对装置进行检修。', '2', '① 确认管路是否安装正确。\r\n② 让加温器ON。\r\n③ 按确定键。等待加温器稳定后再开始治疗；\r\n④ 如再发生，则要对装置进行检修。', );
INSERT INTO `tb_warncode` VALUES ('44', 'W2-11', '气泡检测器异常', '●气泡检测电路板有异常时发生。', '① 按解除键。\r\n② 如再发生，则要对装置进行检修。', '4', null, null);
INSERT INTO `tb_warncode` VALUES ('45', 'W2-12', '停电', '●发生停电时。', '① 请确认电源。\r\n② 确认电源线未脱落。\r\n③ 可运转血液泵。', '2', '', null);
