INSERT INTO `tb_warncode` VALUES ('47', 'W2-14', '发生流量误差(PE)', '●排液量的计测值与计算值的差在200g 以上时发生。\r\n●当分离泵(FP)以 200mL 运转时，监测重量计(WS2)的变化在100g以下或是在300g 以上时发生。', '① 确认排液容器是否与监测重量计连接。\r\n② 处理后按解除键。\r\n③ 如再发生，则要对装置进行检修。', '2', null, null);
