INSERT INTO `tb_warncode` VALUES ('71', 'W3-05', '电源风扇停止', '●', '① 有可能是装置的故障。\r\n② 有可能是装置附近有强噪声源。\r\n③ 将装置的电源OFF 10 秒以后，再次ON。\r\n④ 如再发生这种情况，终止使用。', '1', null, null);
