INSERT INTO `tb_warncode` VALUES ('73', 'W3-07', '重量计(WS4)过负荷', '●监测重量计（WS4）所加的重量超过1.5kg 时发生。（向下负荷）', '① 清除重量计上的负荷。\r\n② 按解除键。\r\n③ 如再发生，则要对装置进行检修。', '2', '1.发生该报警多为称重过负载或称重系统连接出现故障：\r\n    ①请确认该称重系统上是否悬挂重量超过5.5Kg的物体，并移除该物体；\r\n    ②如未悬挂，请尝试【解除】报警，如解除报警，仍触发该报警，请妥善处理当前治疗，并请联系技术人员进行维修。\r\n2.处理后按【确定】。', );
