INSERT INTO `tb_warncode` VALUES ('86', 'W3-20', '泵秤平衡异常', '●称重异常，导致失去平衡；', '①秤WS2或秤WS3剧烈晃动所致，请保持秤平稳；\r\n②其他人为原因所致，在泵秤平衡时，请勿随意触碰秤和设备，也不能随意拖动设备；\r\n③秤称重异常所致，请检查称重系统，如：传感器、标定等等；', '2', '1.查看秤WS2或秤WS3是否剧烈晃动，请保持秤平稳；\r\n2.查看称重系统是否异常，暂停治疗，观察称重系统测量数据是否平稳；如出现异常，请妥善处理当前治疗，并请联系技术人员进行维修；\r\n3.在解除异常因素后，请确保在泵秤平衡期间不要随意触碰秤WS2和秤WS3。 \r\n4. 处理后按【确认】键。', );
